def read_input():

	global ERRO

	buff = ''
	erro = 0

	for line in sys.stdin:

		for char in line:
			if (ord(char) not in range(32,127) 
			and ord(char) not in range(9,11)):
				erro = 1

		buff = buff + line
		
	if erro:
		pass
	else:
		return buff

